import { useState } from "react";
import fertilizerData from "../utils/fertilizerData";

function FertilizerPage() {
  const [crop, setCrop] = useState("");

  const crops = Object.keys(fertilizerData);

  return (
    <div style={{ padding: "20px" }}>
      <h2>ðŸŒ± Fertilizer Recommendation</h2>

      <select
        value={crop}
        onChange={e => setCrop(e.target.value)}
        style={{ padding: "10px", width: "300px" }}
      >
        <option value="">ðŸŒ¾ Select Crop</option>
        {crops.map(c => (
          <option key={c} value={c}>{c}</option>
        ))}
      </select>

      {crop && (
        <table
          border="1"
          cellPadding="10"
          style={{ marginTop: "20px", width: "100%" }}
        >
          <thead>
            <tr>
              <th>Stage</th>
              <th>Fertilizer</th>
              <th>Benefit</th>
            </tr>
          </thead>
          <tbody>
            {fertilizerData[crop].map((f, i) => (
              <tr key={i}>
                <td>{f.stage}</td>
                <td>{f.fertilizer}</td>
                <td>{f.benefit}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default FertilizerPage;
